import React from 'react';
import './Sidebar.css';
import {Link} from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className='side-bar'>
      <ul>
        <li><Link to='/admin-dashboard' className='d-flex align-items-center gap-2'><i className="fa-solid fa-house fa-fw"></i> Dashboard</Link></li>
        <li><Link to='/all-appointments'><i className="fa-solid fa-calendar-days fa-fw"></i> Appointments</Link></li>
        <li><Link to='/add-doctor'><i className="fa-solid fa-plus fa-fw"></i> Add Doctor</Link></li>
        <li><Link to='/doctor-list'><i class="fa-solid fa-users fa-fw"></i> Doctors List</Link></li>
      </ul>
    </div>
  )
}

export default Sidebar
